export default function Tweet(props){
    let date = new Date(props.date_posted);
    let options = {year: 'numeric', month: 'long', day: 'numeric'};
    console.log(date.toLocaleDateString('en-US', options)); 
    return(
        <div className="border-2 rounded-lg p-8 lg:w-5/12 xl:w-5/12 bg-white border-sky-200 hover:bg-sky-50"> 
            {props.content}
            <div>{(props.date_posted)} </div>
        </div>
    );
}
